query:
DELETE FROM property_images 
WHERE image_url IN (
  SELECT image_url FROM (
    SELECT image_url
    FROM property_images
    GROUP BY image_url
    HAVING COUNT(DISTINCT property_id) > 1
  ) as dupes
);

